import { Link } from "react-router-dom";
import "./Navigation.css";

const Navigation = () => {
  return (
    <nav>
      <div className='routes-container'>
        <Link className='home' to='/'>
          plantarrium
        </Link>
      </div>
      Log in
    </nav>
  );
};

export default Navigation;
